import React, { Component } from 'react';


class LandingPage extends Component {
  render() {
    return (
      <div className="LandingPage">

 <h1>Mytinerary</h1>
 <h3>Find you perfect trip, designed by insiders who know and love their cities</h3>
 <h3>Start by Browsing</h3>

      </div>
    );
  }
}

export default LandingPage;
